INSERT INTO `leavetypes` (`id`, `name`, `slug`, `body`, `status`, `created_at`, `updated_at`) VALUES
(1, 'ASUNTOS PARTICULARES', 'asuntos-particulares', 'ES UTILIZADA ÚNICAMENTE PARA ASISTIR A REALIZAR ACTIVIDADES PROPIAS DEL TRABAJADOR, COMO MÁXIMO EL TIEMPO DE AUSENCIA ES DE 02 HORAS Y AL MES NO DEBE DE EXCEDER DE 08 HORAS. ES CONSIDERADA SIN GOCE DE HABER.', 'ACTIVO', '2019-07-02 13:05:25', '2019-11-05 19:35:17'),
(2, 'ENFERMEDAD/GRAVIDEZ', 'enfermedad-gravidez', 'ES UTILIZADA PARA ASISTIR A UNA CITA MÉDICA PROGRAMADA EN ESSALUD, MINSA (CENTRO DE SALUD) O CENTRO MÉDICO PARTICULAR. SE ACREDITA CON LA RESPECTIVA CITA MÉDICA Y LA CONSTANCIA DE ASISTENCIA.\r\n\r\nASIMISMO, PUEDE SER OTORGADA CUANDO EL/LA TRABAJADOR/A PRESENTA ALGUNA SINTOMATOLOGÍA. ES AUTORIZADA EN COORDINACIÓN CON EL ÁREA DE PERSONAL (BIENESTAR SOCIAL)', 'ACTIVO', '2019-07-02 13:05:32', '2019-11-05 19:32:27'),
(3, 'COMISIÓN DE SERVICIOS', 'comision-de-servicios', 'SE UTILIZA EXCLUSIVAMENTE CUANDO SE ASISTE A UNA ENTIDAD PÚBLICA Y/O PRIVADA EN CUMPLIMIENTO DE SUS FUNCIONES, NECESARIAMENTE SE DEBE PRESENTAR LA CONSTANCIA DE PERMANENCIA A SU RETORNO', 'ACTIVO', '2019-07-02 13:05:50', '2019-11-05 19:27:04'),
(4, 'ACTIVIDADES DE LA INSTITUCIÓN', 'actividades-de-la-institucion', 'SE UTILIZA ÚNICAMENTE PARA ASISTIR A ACTIVIDADES ORGANIZADAS POR LA INSTITUCIÓN (CAPACITACIONES, TALLERES Y SIMILARES).', 'ACTIVO', '2019-07-02 13:05:56', '2019-11-05 19:21:17'),
(5, 'DOCENCIA UNIVERSITARIA', 'docencia-universitaria', 'SE UTILIZA ÚNICAMENTE CUANDO PREVIAMENTE SE HA PRESENTADO AL ÁREA DE PERSONAL EL RESPECTIVO CONTRATO COMO DOCENTE UNIVERSITARIO Y EL HORARIO DE CLASES SUSCRITO POR LA AUTORIDAD UNIVERSITARIA CORRESPONDIENTE', 'ACTIVO', '2019-07-02 13:06:01', '2019-11-05 19:19:15'),
(6, 'ESTUDIOS UNIVERSITARIOS SATISFACTORIOS', 'estudios-universitarios-satisfactorios', 'SE UTILIZA ÚNICAMENTE CUANDO PREVIAMENTE SE HA PRESENTADO AL ÁREA DE PERSONAL EL RESPECTIVO HORARIO DE CLASES SUSCRITO POR LA AUTORIDAD UNIVERSITARIA CORRESPONDIENTE Y LA CONSTANCIA DE ESTAR REALIZANDO SUS ESTUDIOS DE MANERA SATISFACTORIA.', 'ACTIVO', '2019-07-02 13:06:06', '2019-11-05 19:17:28'),
(7, 'CAPACITACIÓN OFICIALIZADA', 'capacitacion-oficializada', 'SE UTILIZA ÚNICAMENTE CUANDO SE ASISTE A UNA CAPACITACIÓN QUE HA SIDO CONVOCADA POR LA DREA/MINEDU/GORE, SE ACREDITA CON LA RESPECTIVA INVITACIÓN Y LA CONSTANCIA DE ASISTENCIA (ES CONSIDERADA CON GOCE DE HABER).', 'ACTIVO', '2019-07-12 13:25:48', '2019-11-05 19:15:09'),
(8, 'CAPACITACIÓN  NO OFICIALIZADA', 'capacitacion-no-oficializada', 'SE UTILIZA ÚNICAMENTE CUANDO SE ASISTE A UNA CAPACITACIÓN QUE NO HA SIDO CONVOCADA POR LA DREA, SE ACREDITA CON LA RESPECTIVA CONSTANCIA DE ASISTENCIA (ES CONSIDERADA SIN GOCE DE HABER).', 'ACTIVO', '2019-07-12 13:26:06', '2019-11-05 19:13:59'),
(9, 'CITACIÓN JUDICIAL/FISCAL/MILITAR/POLICIAL', 'citacion-judicial-fiscal-militar-policial', 'SE UTILIZA ÚNICAMENTE CUANDO SE TIENE UNA CITACIÓN DEL PODER JUDICIAL, MINISTERIO PÚBLICO (FISCALÍA) O DE LA POLICÍA, SE ACREDITA CON LA RESPECTIVA NOTIFICACIÓN', 'ACTIVO', '2019-08-19 15:52:28', '2019-11-05 19:14:16');
